import React from 'react';
import { View, ListItem, Icon } from '../../atoms';
import { InfoText } from "../../molecules";

import styles from "./styles";

const MenuList = ({
    title,
    listItem,
}) => {

    const listContent = [];

    if(listItem.title === undefined){
        for(let i = 0; i < listItem.length; i++){
            listContent.push(
                <ListItem
                    title={listItem[i].title}
                    onPress={listItem[i].onPress}
                    rightIcon={listItem[i].rightIcon}
                    rightTitle={listItem[i].rightTitle}
                    rightTitleStyle={listItem[i].rightTitleStyle}
                    containerStyle={listItem[i].containerStyle}
                    leftIcon={
                        <View style={listItem[i].leftIconContainerStyle}>
                            <Icon
                                {...listItem[i].leftIcon}
                            />
                        </View>
                    }
                
            />
            );
        }
    }else{
        listContent.push(
            <ListItem
                title={listItem.title}
                onPress={listItem.onPress}
                rightIcon={listItem.rightIcon}
                rightTitle={listItem.rightTitle}
                rightTitleStyle={listItem.rightTitleStyle}
                containerStyle={listItem.containerStyle}
                leftIcon={
                    <View style={listItem.leftIconContainerStyle}>
                        <Icon
                            {...listItem.leftIcon}
                        />
                    </View>
                }
                
            />
        );
    }

    return (
        <View style={styles.container}>
            <InfoText>{title}</InfoText>
            <View>
                {listContent}
            </View>
        </View>
    );
};

export { MenuList };
